import React, { useState } from 'react';
import './index.css';

const appsList = [
  { id: '1', name: 'Facebook', iconUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQis7iuHwI9OiIDYWrRcGOodFAvYf3Fne38Ug&s' },
  { id: '2', name: 'Messenger', iconUrl: 'data:image/jpeg;base64,' },
  { id: '3', name: 'WhatsApp', iconUrl: 'data:image/jpeg;base64,' },
  { id: '4', name: 'Instagram', iconUrl: 'data:image/jpeg;base64,' },
  { id: '5', name: 'Snapchat', iconUrl: 'data:image/png;base64,' },
  { id: '6', name: 'Twitter', iconUrl: 'data:image/png;base64,' },
  { id: '7', name: 'Pinterest', iconUrl: 'data:image/png;base64,' },
  { id: '8', name: 'WeChat', iconUrl: 'data:image/png;base64,' },
  { id: '9', name: 'LinkedIn', iconUrl: 'data:image/png;base64,' },
  { id: '10', name: 'Telegram', iconUrl: 'data:image/png;base64,' },
  // Add more apps as needed
];

const AppStore = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('Social');

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
  };

  const handleCategoryChange = (category) => {
    setSelectedCategory(category);
  };

  const filteredApps = appsList.filter((app) =>
    app.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="app-store-container">
      <h1 className="title">App Store</h1>
      <input
        type="text"
        placeholder="Search"
        value={searchTerm}
        onChange={handleSearchChange}
        className="search-input"
      />
      <div className="categories">
        {['Social', 'Games', 'News', 'Food'].map((category) => (
          <button
            key={category}
            className={`category-button ${selectedCategory === category ? 'active' : ''}`}
            onClick={() => handleCategoryChange(category)}
          >
            {category}
          </button>
        ))}
      </div>
      <div className="apps-grid">
        {filteredApps.map((app) => (
          <div key={app.id} className="app-card">
            <img src={app.iconUrl} alt={app.name} className="app-icon" />
            <p className="app-name">{app.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AppStore;
